import React from "react";

const goToNextPage = () => {
  () => navigation.navigate("CheckInBags");
};

const NavigationButton = ({ navigation }) => {
  <Button title={buttonInfo} color="#244D9D" onPress={<NavigationButton />} />;
};

export default NavigationButton;
